import React from "react";
import {View, Text} from "react-native";

const App = () =>{
  return (
    <View style={{backgroundColor:"gray",flex:1,justifyContent:"center",alignItems:"center"}}>
      <Text style={{color:"yellow",fontSize:"25px"}}>Hello React Native!</Text>
    </View>
  )
};


export default App;
